import React , {Component} from "react"
import Cards from "./Cards"

class Home extends Component{
    state={
        data:{
            _id:"",
            Name: "",
            Price: "",
            Description: "",
            Categery:"",

        },
        Categery:["Laptop", "Smart Phones","Accessories"]
        ,
        user:{
            Name:"",
            Email: "",
            Password: "",
            CreatedItems: []
        }


    }

    render(){
        const { data } = this.state;
        return(
            <Cards Name={data.Name} 
                    Price={data.Price} 
                    Description={data.Description}
                    SellingBy={data.SellingBy}/>
        )
    }
}

export default Home;
